import React,{useState} from 'react';
import client from '../util/shopify-client'


const ItemList = () => {
    const [stash, setStash] = useState([]);

    return (
        <div>
            {
                client.product.fetchAll().then((products) => {
                    setStash(products)    
                })    

            }
            Hello hello
        </div>
    )
}



const Store = () => {
    return(
        <div style={{
            position:"relative",
            top:"20vh"
        }}>
            <ItemList />
        </div>
    )
}

export default Store;
